import React, { Component } from "react";
import styled from "styled-components";
import { Col, Carousel } from "antd";
import Photo1 from "../images/Photo1.jpg";
import Photo2 from "../images/Photo2.jpg";
import Photo3 from "../images/Photo3.jpg";
import Photo4 from "../images/Photo4.jpg";
import Photo5 from "../images/Photo5.jpg";

export class ProfileImage extends Component {
  render() {
    return (
      <Col
        span={8}
        style={{
          margin: "auto",
        //   border: "2px solid white",
          borderRadius: "50%"
        }}
      >
        <Carousel autoplay style={{ background: "black" }}>
          <div>
            <img src={Photo1} style={{ width: "100%", height: "500px", borderRadius: "50%", }} />
          </div>
          <div>
            <img src={Photo2} style={{ width: "100%", height: "500px",  borderRadius: "100%" }} />
          </div>
          <div>
            <img src={Photo3} style={{ width: "100%", height: "500px",  borderRadius: "100%" }} />
          </div>
          <div>
            <img src={Photo4} style={{ width: "100%", height: "500px",  borderRadius: "100%" }} />
          </div>
        </Carousel>
      </Col>
    );
  }
}

export default ProfileImage;
